import Head from "next/head";
import Container from "./Container";

const Layout = (props) => (
  <div>
    <Head>
      <title>Demo App</title>
    </Head>
    <Container>
      <div className="container">{props.children}</div>
    </Container>
  </div>
);

export default Layout;
